-- Eliminar la base de datos si existe
DROP DATABASE IF EXISTS Vuelos;
-- Crear la base de datos
CREATE DATABASE Vuelos;
-- Usar la base de datos creada
USE Vuelos;
-- --------------------------------------------------------
--
-- Crear la tabla de aeropuertos
--
CREATE TABLE aeropuertos (
    codigo_aeropuerto CHAR(3),
    nombre VARCHAR(100) NOT NULL,
    ciudad VARCHAR(100) NOT NULL,
    pais VARCHAR(100) NOT NULL,
    PRIMARY KEY (codigo_aeropuerto)
);
-- --------------------------------------------------------
--
-- Crear la tabla de aviones
--
CREATE TABLE aviones (
    matricula VARCHAR(7),
    modelo VARCHAR(100) NOT NULL,
    capacidad INT NOT NULL,
    nombre_aerolinea VARCHAR(100),
    PRIMARY KEY (matricula)
);
-- --------------------------------------------------------
--
-- Crear la tabla de pasajeros
--
CREATE TABLE pasajeros (
    dni CHAR(9), 
    nombre VARCHAR(100) NOT NULL,
    apellidos VARCHAR(100) NOT NULL,
    pasaporte CHAR(9) NOT NULL UNIQUE,
    nacionalidad VARCHAR(50),
    fecha_nacimiento DATE,
    PRIMARY KEY (dni) 
);
-- --------------------------------------------------------
--
-- Crear la tabla de vuelos
--
CREATE TABLE vuelos (
    codigo_vuelo INT AUTO_INCREMENT,
    matricula_avion VARCHAR(7),
    origen CHAR(3) NOT NULL,
    destino CHAR(3) NOT NULL,
    salida DATETIME NOT NULL,
    llegada DATETIME,
    PRIMARY KEY (codigo_vuelo) 
);
-- --------------------------------------------------------
--
-- Crear la tabla de billetes
--
CREATE TABLE billetes (
    id INT AUTO_INCREMENT, 
    dni_pasajero CHAR(9),
    codigo_vuelo INT,
    asiento VARCHAR(10),
    peso_equipaje DECIMAL(4,2),
    PRIMARY KEY (id) 
);
-- --------------------------------------------------------
--
-- Añadir las claves foráneas
--
ALTER TABLE vuelos 
    ADD FOREIGN KEY (matricula_avion) REFERENCES aviones(matricula) ON DELETE CASCADE ON UPDATE CASCADE,
    ADD FOREIGN KEY (origen) REFERENCES aeropuertos(codigo_aeropuerto) ON DELETE CASCADE ON UPDATE CASCADE,
    ADD FOREIGN KEY (destino) REFERENCES aeropuertos(codigo_aeropuerto) ON DELETE CASCADE ON UPDATE CASCADE;
ALTER TABLE billetes 
    ADD FOREIGN KEY (dni_pasajero) REFERENCES pasajeros(dni) ON DELETE CASCADE ON UPDATE CASCADE,
    ADD FOREIGN KEY (codigo_vuelo) REFERENCES vuelos(codigo_vuelo) ON DELETE CASCADE ON UPDATE CASCADE;
